	const [loading, setLoading] = useState(false);

	const showItems = () => {
    var renderItems = [];
    for (var i = 0; i < items; i++) {
      renderItems.push(<li key={i}>Photo {i}</li>);
    }
    return renderItems;
	};

	useEffect(() => {
		 
	})
	

	return (
		<div
		>
			Gallery
			<ul>
				{showItems()}
			</ul>
			{loading ? <p>loading...</p> : ""}
		</div>
	);

};

export default Gallery;
